import './test.css'
let a = "checked"
function name(){
    
    return (
        <div class="main-con">
            <div class="nav-bar">
                <h1 class="nav-heading">Wallpaper Flare</h1>
                <input type="search" class="search" placeholder="Search HD wallpaper" />
            </div>
            <input type="radio" class="radio"  />
            <input type="radio" class="radio"  />
            <input type="radio" class="radio" {...a} />
        </div>
    )
}
 
export default name;
